<p class="MsoNormal">
	<span><span>&nbsp; </span>2</span><span style="font-family:宋体;">月</span><span>10</span><span style="font-family:宋体;">日，七年级十班</span><span>50</span><span style="font-family:宋体;">名同学与家委会家长和班主任一同前往合肥市退役军人就业培训基地开展</span><span>“</span><span style="font-family:宋体;">红星照耀中国</span><span>”</span><span style="font-family:宋体;">青少年爱国主题教育活动。</span><span></span> 
</p>
<p class="MsoNormal">
	<span><span>&nbsp; </span></span><span style="font-family:宋体;">郑教官为同学们讲述了退役军人志愿者们支援郑州水灾的许多精彩故事，胡教官为同学们讲解了急救自护的知识。</span><span style="font-family:宋体;"></span> 
</p>
<p class="MsoNormal">
	<span><span>&nbsp; </span></span><span style="font-family:宋体;">最后，由七年级十班学生代表为安徽省爱国拥军促进会老兵应急救援队赠予锦旗。同学们也收到了救援队赠送的图书</span><span>—</span><span style="font-family:宋体;">《红星照耀中国》与国旗样式中性笔。</span><span></span> 
</p>
<p class="MsoNormal">
	<span><span>&nbsp; </span></span><span style="font-family:宋体;">本次活动通过趣味的知识、直观的图片、感人的故事，使全体七十班同学的爱国主义思想得到有力深化。</span> 
</p>
